export const Pokedex = () => {
  const client = new ApolloClient({
    uri: "https://beta.pokeapi.co/graphql/v1beta",
    cache: new InMemoryCache(),
  });

  return (
    <main className="App-home">
      <div>Pokedex page</div>
      <ApolloProvider client={client}>
        <SearchForm />
        <PokemonsContainer />
      </ApolloProvider>
    </main>
  );
};
